            <link href="https://fonts.googleapis.com/icon?family=Material+Icons"
      rel="stylesheet"/>                  
        </Head>
        <Navbar/>
        <div className="container">
            {props.children}
        </div>
        <div className="modal fade" id="myModal" role="dialog">
<Form/>
    </div>
        <Footer/>  
    </div>
);

export default Layout;
